import React , {useEffect, useState} from 'react';
import Axios from 'axios';
import {ManagerNavBar} from "../components/ManagerNavBar";

export const Legacy = ()=> {

    //Necessary variables
    const [legTDList, setlegTDList] = useState([]);

    //required methods

    const showVeh = ()=>{
        Axios.get("http://localhost:3005/legacy").then((response)=> {
            setlegTDList(response.data);
        });
    };


    //Render page code

    return (
        <div>
            <h1>Manager</h1>
            {<ManagerNavBar/>}
            <hr></hr>
            <div>
                <button onClick = {showlegacyTD}>Show legacy testdrives</button>
                    {legTDList.map( (val, key)=> {
                    return <div className='vehicles'>
                                <h2>{val.model}</h2>
                                <h2>{val.type}</h2>
                            </div>
                                
                    })}
            </div>
        </div>
    );
}
